pragma solidity >=0.4.22 <0.6.0;


import "./openzeppelin_data/Address.sol";
import "./openzeppelin_data/Counters.sol";

contract ticketingSystem{
	using Address for address;
    using Counters for Counters.Counter;
	
	
	struct artist{
	address owner;
	string name;
	uint artistCategory;
	bool hasBeenModified;
	}
	
	mapping(uint => artist) public _artists;
	uint public nextArtistIndex;
	
	event createdAnArtist(uint objectNumber);
	
	function createArtist(string memory _name, uint _cat) internal {
		
		nextArtistIndex=1;
		_artists[nextArtistIndex].owner=msg.sender;
		_artists[nextArtistIndex].name=_name;
		_artists[nextArtistIndex].artistCategory=_cat;
	    _artists[nextArtistIndex].hasBeenModified=false;
		nextArtistIndex = nextArtistIndex + 1;
		
		emit createdAnArtist(nextArtistIndex);
	}
	
	function artistsRegister(uint index) public returns(address, string memory,uint, bool)
	{
		return (_artists[index].owner, _artists[index].name, _artists[index].artistCategory, _artists[index].hasBeenModified);
	}
	
	
	/*function modifyArtist(uint index, string memory _name) public {
